import { lazy } from 'react'
// import {
//   HomeOutlined,
//   PictureOutlined,
//   MenuOutlined,
//   PicLeftOutlined,
//   SwapLeftOutlined,
//   BorderTopOutlined,
//   ClockCircleOutlined,
//   UserOutlined,
//   AppstoreOutlined
// } from '@ant-design/icons'
const menus = [
  { 
    path: '/',
    key: '/',
    redirect: '/investment',
    meta: { 
      hidden: true
    }
  },
  {
    path: '/investment',
    key: '0-0',
    title: '投资',
    component: lazy(() => import('./../views/Investment'))
  },
  {
    path: '/investmentDetail',
    key: '0-0-1',
    title: '投资明细',
    component: lazy(() => import('./../views/InvestmentDetail')),
    meta:{
      hidden:true
    }
  },
  {
    path: '/AutomaticInvestment',
    key: '0-1',
    title: '自动化投资',
    component: lazy(() => import('./../views/AutomaticInvestment'))
  },
]

export default  menus
